import { Nav, NavRow, Row, Col, Card } from 'react-bootstrap';
import { connect } from 'react-redux';
import { Link, useHistory, NavLink } from 'react-router-dom';
import { fetch_user } from '../api';
import Carousel from 'react-bootstrap/Carousel';

function WellnessList({current_wellness, session}) {
  function photo_path(hash) {
    return "http://localhost:4000/photos/" + hash;
  }
  function ListingArticles() {
    let rows = wellness.map((health) => {
      let body = health.body.substring(0, 280) + " ..."
      return (
        <Card fluid className="my-4">
          <Card.Header>Kitten Care</Card.Header>
          <Card.Body>
            <h1 className="">{health.title}</h1>
            <p>{body}</p>
            <Link to="/" className="text-danger">Read More</Link>
          </Card.Body>
        </Card>
    )});

    return(
      <div className="ml-3">
        {rows}
      </div>
    )
  }

  function Redirect({to, children}) {
    return (
      <Nav.Item>
        <NavLink to={to} exact
          className="btn btn-lg font-weight-bold text-light btn-info"
          activeClassName="active">
          {children}
        </NavLink>
      </Nav.Item>
    );
  }


  return (
    <div>
      <ListingArticles />
    </div>
  );
}

function state2props({current_wellness, session}) {
  return { current_wellness, session};
}

export default connect(state2props)(WellnessList);
